import React, { useState } from "react";
import "./ReservarLab.css";

const ReservarLab = ({isOpenE, closeE}) =>{

    return(
    <div className={`ElContainer ${isOpenE && 'ElContainer-Open'}`}>
        <div className="El-Dialog">
            <h2 className="TituloEl">Reservar laboratorio Física 1</h2>
            <h3 className="SubTitEl">¿Desea eliminar la reserva?</h3>
            <div className="Buttons">
                <button>Si</button>
                <button onClick={closeE}>No</button>
            </div>
        </div>
    </div>
    );
}

export default ReservarLab;
